// GetMetamagicData returns the loaded metamagic data.
func GetMetamagicData() *MetamagicChummer {
	return metamagicData
}

// GetAllMetamagics returns all metamagics.
func GetAllMetamagics() []MetamagicItem {
	if len(metamagicData.Metamagics) == 0 {
		return []MetamagicItem{}
	}
	return metamagicData.Metamagics[0].Metamagic
}

// GetMetamagicByID returns the metamagic with the given ID, or nil if not found.
func GetMetamagicByID(id string) *MetamagicItem {
	metamagics := GetAllMetamagics()
	for i := range metamagics {
		if metamagics[i].ID == id {
			return &metamagics[i]
		}
	}
	return nil
}
